function SPAIAdmin(){}SPAIAdmin.prototype.adjustSettingsTabsHeight=function(){var e=jQuery(".wp-shortpixel-ai-options section#tab-settings table").height()+80;e=Math.max(e,jQuery(".wp-shortpixel-ai-options section#tab-adv-settings table").height()+80);e=Math.max(e,jQuery("section#tab-resources .area1").height()+60);jQuery("#shortpixel-ai-settings-tabs").css("height",e);jQuery("#shortpixel-ai-settings-tabs section").css("height",e)};SPAIAdmin.prototype.switchSettingsTab=function(e){var t=e.replace("tab-",""),i=jQuery("section#"+e);jQuery('input[name="section_name"]').val(t);var s=window.location.href.toString();if(s.indexOf("?")>0){var a=s.substring(0,s.indexOf("?"));a+="?"+jQuery.param({page:"shortpixel_ai_settings_page",section:t});window.history.replaceState({},document.title,a)}if(i.length>0){jQuery("section").removeClass("sel-tab");jQuery("section#"+e).addClass("sel-tab")}};SPAIAdmin.prototype.dismissNotice=function(e,t,i){jQuery("#short-pixel-ai-notice-"+t).hide();var s={action:"shortpixel_ai_dismiss_notice",notice_id:t,call:i};jQuery.get(e,s,function(e){s=JSON.parse(e);if(s["Status"]=="success"){console.log("dismissed");jQuery("#short-pixel-ai-success-"+t).show()}else{jQuery("#short-pixel-ai-notice-"+t).show();if(typeof s["Details"]!==undefined&&s["Details"]["Status"]==-3){jQuery("#short-pixel-ai-notice-"+t+" .spai-action-error").text(s["Details"]["Message"])}jQuery("#short-pixel-ai-notice-"+t+" .spai-action-error").css("display","inline-block")}})};SPAIAdmin.prototype.clearCssCache=function(e,t){t.stopPropagation();t.target.setAttribute("disabled","true");jQuery(t.target).addClass("button").removeClass("button-primary");t.target.innerText="Clearing the cache...";var i={action:"shortpixel_ai_clear_css_cache"};jQuery.get(e,i,function(e){t.target.innerText=". Cache  cleared ."})};window.ShortPixelAIAdmin=new SPAIAdmin;